VALUES ('3263859890117', '8 cônes 4 goût chocolat, 4 goût vanille', 'Glace saveur chocolat 34 % : eau, _lait_ écrémé reconstitué, sirop de glucose-fructose de _blé_, sucre, matière grasse végétale de coco, poudre de cacao maigre 5 %, _lactose_ et protéines de _lait_, émulsifiant : mono- et diglycérides d\'acides gras de palme et de colza, stabilisants : gomme guar, farine de graine de caroube. Glace saveur vanille 34 % : eau, sucre, _lactose_ et protéines de _lait_, sirop de glucose-fructose de _blé_, matière grasse végétale de coco, émulsifiants : mono- et diglycérides d\'acides gras de palme et de colza, stabilisants : gomme guar, farine de graine de caroube, colorant : bêta-carotène, vanilline, arôme. Gaufre 18,5 % : farine de _blé_, sucre, matière grasse végétale de coco, sucre, cacao maigre en poudre 9 %, émulsifiant : lécithine de _soja_. Croquants aux _noisettes_ 1,5 % : sucre, _noisettes_ 20 %.', 'https://static.openfoodfacts.org/images/products/326/385/989/0117/front_fr.8.400.jpg', '11.4', '9.7', '37.7', '30', '', '2.8', '', '', '', '0');

