VALUES ('3263859890216', 'Cônes duo parfum vanille', '_Lait_ écrémé réhydraté - eau - cornet biscuit 18% (farine de _blé_ - sucre - graisse végétale de coprah - émulsifiant : lécithines de _soja_) - chemisage au cacao maigre (graisse végétale de palmiste et palme - sucre - poudre de cacao maigre 10% - émulsifiant : lécithines de _soja_) - sirop de glucose-fructose - sucre - graisse végétale de coprah - _lactose_ et protéines de _lait_ - décor au cacao maigre (graisse végétale de coprah et palmiste - sucre - poudre de cacao maigre 15% - émulsifiant : lécithine de _soja_) - _noisettes_ grillées sucrées (sucre - _noisettes_ 10%) - arôme naturel de vanille 0,5% - émulsifiants: mono - et diglycérides d\'acides gras, esters de propane 1,2-diol d\'acides gras - stabilisants : farine de graines de caroube, gomme guar, carraghénanes - gousses de vanille épuisées et broyées 0,03% - colorants: rocou, curcumine - arôme naturel.', 'https://static.openfoodfacts.org/images/products/326/385/989/0216/front_fr.15.400.jpg', '15', '12', '37', '26', '', '2.4', '0.13', '0.0511811023622047', '', '0');

