VALUES ('3263859894313', '4 Cônes Crème brûlée', 'Glace saveur crème brûlée 63,5% : lait écrémé reconstitué, eau,sirop de glucose de blé, matière grasse végétale de noix de coco, sucre,lactose et protéines de lait, sirop de glucose fructose de blé, jaune d’œuf en poudre 1,5%*, émulsifiant : mono et diglycérides d’acides gras de palme et de colza; gélifiants: farine de graines de caroube et gomme guar, colorant: carotènes végétaux, vanilline, arôme. *Pourcentage exprimé sur la glace saveur crème brûlée.  Gaufre l8,2% : farine de blé, sucre, matière grasse végétale de noix de coco, émulsifiant:lécithine de soja, sel. Chemisage au cacao maigre 8,7%: matière grasse végétale de noix de coco, sucre, cacao maigre en poudre 9%*, émulsifiant: lecithine de soja. *Pourcentage exprimé sur le chemisage au cacao maigre. Sauce caramel 8%: sirop de caramel 50%*, eau, sucre, sirop de glucose fructose de blé, épaississant: amidon transformé de pomme de terre, colorant : caramel, acidifiant : citrate de sodium, gélifiant:  farine de graines de caroube, arôme naturel.  Morceaux de sucre caramélisés 1,6%: saccharose, beurre de cacao, eau. ', 'https://static.openfoodfacts.org/images/products/326/385/989/4313/front_fr.9.400.jpg', '12', '9.8', '43', '29.9', '0.6', '3.5', '0.3302', '0.13', '', '0');

