VALUES ('3263859922412', '2 Croustillants Chocolat et Noisettes', '_Crème_ - pâte de _noisette_ 12%, chocolat noir 9% (pâte de cacao, sucre, poudre de cacao, émulsifiant: lécithine de _soja_), pâte de praliné 9% (sucre, _noisette_, huile de _noisette_ ), chocolat au _lait_ 8% ( sucre, beurre de cacao, poudre de _lait_ entier, pâte de cacao, émulsifiant: lécithine de _soja_, sel, arôme naturel de vanille), _œuf_ entier liquide, brisure de crêpes dentelles 7% (farine de _blé_, sucre, _beurre_ concentré, poudre de _lait_ écrémé, malt d\'_orge_, sel), jaune d\'_œuf_ liquide, sucre, _beurre_ concentré, sirop de glucose-fructose, eau, cacao en poudre 1%, farine de _blé_, chocolat noir 0,4% (pâte de cacao, sucre, émulsifiant : lécithine de _soja_, arôme naturel de vanille, stabilisant : sirop de sorbitol, huile de tournesol, émulsifiant: mono- et diglycérides d\'acides gras.', 'https://static.openfoodfacts.org/images/products/326/385/992/2412/front_fr.3.400.jpg', '30.3', '11.7', '35.5', '21.3', '4.4', '7.9', '0.1', '0.0393700787401575', '', '1');

