INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3263859923211', 'Macarons aux Chocolats Grandes Origines', 'Ingrédients Macaron chocolat origine Ghana : [chocolat 26% (sucre - beurre de cacao - poudre de lait entier - pate de cacao du Ghana 17% - émulsifiant : lécithine de soja - vanille naturelle en poudre)- sucre - amandes 14% - sucre glace - blanc d\'œuf liquide · lait - crème - beurre de cacao - beurre - sirop de sucre inverti - sirop de glucose - cacao maigre en poudre - colorants: rouge de betterave, carotenes, carmins de cochenille] - Macaron chocolat origine Mexigue 2 [chocolat 19% (pâte de cacao du Mexique 63,5% - sucre - beurre de cacao - émulsifiant 1 lécithine de soja - vanille naturelle en poudre)- sucre - amandes 12% - sucre glace - blanc d\'œuf liquide - crème — lait - praliné (noisettes 60% - sucre)- noisettes 5% - sirop de glucose - sirop de sucre inverti - beurre cle cacao - extrait d\'orge malté - colorants : rouge de betterave, charbon végétal médicinal] - Macaron chocolat origine Papouasie - Nouvelle Guinée: [chocolat 22% (sucre - beurre de cacao - poudre de lait entier - pâte de cacao de Papouasie - Nouvelle Guinée 12% - émulsifiant : lécithine , de soja - arôme naturel de vanille)- sucre - amandes 17% - sucre glace - blanc d\'œuf liquide - crème - eau - beurre de cacao - beurre salé - extrait d\'orge malté - sel- colorants : caramel ordinaire, carotènes, carmins de cochenille, dioxyde de titane, oxydes de fer, silicate alumino·potassique] - Macaron chocolat origine Tanzanie: [sucre - chocolat 17% (pâte de cacao de Tanzanie 69% - sucre - beurre de cacao - vanille naturelle en poudre)- amandes 15%- blanc d\'œuf liquide - sucre glace - crème - lait- sirop de sucre inverti · sirop de glucose - beurre - beurre de cacao - colorants : rouge de betterave, charbon végétal médicinal - pâte de cacao - extrait d\'orge malte]. Traces de graines de sésame et autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/326/385/992/3211/front_fr.14.400.jpg', '24.1', '8.5', '51.6', '51.6', '4.6', '9.6', '0.15', '0.0590551181102362', '', '0');

