VALUES ('3263859923518', '12 Mini-Choux Caramel - Pistache - Vanille - Praliné', '_Lait_, _beurre_, fondant déshydraté (sucre, sirop de glucose), sucre, _oeuf_, chocolat blanc (sucre, beurre de cacao, poudre de _lait_ entier, émulsifiant : lécithine de _soja_, vanille naturelle), jaune d\'_oeuf_, caramel au beurre salé (sucre, _crème_, _beurre_ salé 0,6 %, sirop de glucose, fleur de sel, poudre de vanille), farine de _blé_, praliné 2,4 % (_noisettes_ 1,4 %, sucre), préparation pour crème (amidon de maïs, amidon de maïs), fécule de pomme de terre, sel, arôme pistache, vanille Bourbon en poudre 0,1 %, gélifiant : carraghénanes, colorants : dioxyde de titane, bêta-carotènes, caramel ordinaire, complexe de cuivre-chlorophylles, charbon végétal médicinal.', 'https://static.openfoodfacts.org/images/products/326/385/992/3518/front_fr.20.400.jpg', '26.2', '14.8', '34', '25.3', '', '6.2', '0.48', '0.188976377952756', '', '0');

