VALUES ('3263859924010', 'Assortiment de Macarons Framboise, Pistache, Chocolat, Vanille', 'Macaron framboise : sucre glace - fourrage à la framboise 28% (sucre - brisure de framboise 7,6% - purée de framboise 7,6% - jus de citron - gélifiant : pectines) - _amandes_ 18,6% - blanc d’_œuf_ - eau - sucre - colorant : rouge de betterave - blanc d’_œuf_ en poudre. Macaron chocolat : sucre glace - _amandes_ 18,6% - blanc d’_œuf_ - _crème_ (_crème_ de _lait_ - stabilisant: carraghénanes) - eau - chocolat noir de couverture 7,3% (pâte de cacao - sucre - cacao maigre en poudre - émulsifiant : lécithine de _soja_ - arôme naturel de vanille) - chocolat de couverture 2,9% (pâte de cacao — sucre — beurre de cacao - lécithine de _soja_ - extrait de vanille) - sirop de sucre inverti - poudre de cacao maigre alcaline 2,4% — sucre - blanc d’_œuf_ en poudre. Macaron pistache : sucre glace - _amandes_ 21,6% - blanc d’_œuf_ - beurre - sucre - eau - _lait_ demi écrémé — jaune d’_œuf_ - pistache 1,2% - blanc d’_œuf_ en poudre - arôme  naturel d’_amande_ amère - colorants : complexes cuivre-chlorophylles - extrait de curcuma. Macaron vanille : sucre glace - _amandes_ 20,2% - blanc d’_œuf_ - beurre - sucre - eau - _lait_ demi écrémé - jaune d’_œuf_ - blanc d’_œuf_ en poudre - arômes naturels de vanille 0,3% - poudre de vanille broyée épuisée 0,06%.', 'https://static.openfoodfacts.org/images/products/326/385/992/4010/front_fr.12.400.jpg', '18.9', '6.2', '51.3', '45.4', '4.3', '7.8', '0.16', '0.062992125984252', '', '0');

