INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3263859926014', 'Croustillant', 'Mousse au chocolat noir 46,9%, croustillant au praliné 35,970, génoise au cacao 16%, décor au chocolat noir I surgelé. Ingrédients Crème - chocolat noir I I % (pâte de cacao - sucre - cacao maigre en poudre - émulsifiant : lécithine de soja) - pâte de noisette - pâte de praliné 8% (sucre - noisette torréfiée - huile de noisette) - chocolat au lait (sucre - beurre de cacao - lait entier en poudre - pâte de cacao - émulsifiant : lécithine de soja - arôme naturel de vanille) - œuf entier liquide - jaune d\'œuf liquide - biscuit finement émietté (sucre - farine de blé - huiles et graisses végétales de tournesol et de colza en proportion variable - matière grasse laitière anhydre - lactose - protéines de lait - sel - extrait de malt d\'orge - poudre à lever : carbonate acide de sodium - émulsifiant : lécithine de tournesol - antioxydant : extraits riches en tocophérols) - sucre - sirop de glucose-fructose - beurre pâtissier - farine de blé - eau - cacao en poudre 1% - chocolat noir 0,7% (pâte de cacao - sucre - émulsifiant : lécithine de soja - arôme naturel de vanille) - huile de tournesol - stabilisant : sirop de sorbitol - émulsifiant : mono - et diglycérides d\'acides gras. Traces d\'autres fruits à coque et de graines de sésame. Les informations en gras sont destinées aux personnes allergiques ou intolérantes.', 'https://static.openfoodfacts.org/images/products/326/385/992/6014/front_fr.8.400.jpg', '32', '13.6', '29.2', '23.1', '0', '7.2', '0.13', '0.0511811023622047', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3263859926113', '12 mignardises', 'Tartelette framboise :  framboise 46,8% - fond de tartelette sucré 25,2% (farine de blé beurre 5,5% -sucre glace - œuf entier pasteurisé- eau - fibres de blé - fécule de manioc) - sucre - chocolat blanc 5,5% (sucre - beurre de cacao - poudre de lait entier - émulsifiant: lécithine de soja - arôme naturel de vanille) - beurre de cacao - gélifiant : pectines - chocolat de couverture (pâte de cacao - sucre - beurre de cacao - lécithine de soja extrait de vanille). Pourcentages exprimés sur la tartelette framboise.  Entremets chocolat coco :  chocolat de couverture 33,1% (pâte de cacao -sucre - beurre de cacao - lécithine de soja - extrait de vanille) - chocolat de couverture au lait 13,9% (sucre-beurre de cacao - poudre de lait entier - pâte de cacao - émulsifiant lécithine de soja - sel - arôme naturel de vanille) - biscuit à la noix de coco 10,3% (œuf entier sucre -farine de blé - poudre de noix de coco 1,2% - eau - huile végétale de colza - poudre de lait - poudres à lever: Pyrophosphate de soude, bicarbonate de soude crème stérilisée (crème de lait stabilisant : carraghénanes) - huile de tournesol - lait demi écrémé stérilisé sucre -brisures de crêpe dentelle 4,1 % ( farine de blé sucre - beurre concentré - lait écrémé en poudre- farine d\'orge malté sel) - beurre - poudre de cacao maigre 2,5% - eau - arôme naturel de noix de coco avec autres arômes naturels-beurre de cacao. Pourcentages exprimés sur l\'entremets chocolat Coco  Mini-éclair au caramel:  caramel au beurre et au sel de Guérande 27,5% [sirop de glucose-fructose confiture de lait (lait entier frais - sucre lait écrémé en poudre) - beurre 4,7% - sucre - eau lait entier en poudre sel de Guérande 0,1%-jus de citron] lait demi écrémé stérilisé fondant 16,4 % (sucre eau sirop de glucose émulsifiant mono et diglycérides d\'acides gras - épaississants : agar agar, farine de graines de caroube) œuf entier pasteurisé farine de blé eau chocolat blanc 3,6% (sucre - beurre de cacao - poudre de lait entier - émulsifiant : lécithine de soja - arôme naturel de vanille) - beurre chocolat de couverture au lait 2,8% (sucre - beurre de cacao - poudre de lait entier - pâte de cacao émulsifiant : lécithine de soja sel arôme naturel de vanille) - jaune d\'œuf pasteurisé sucre beurre de cacao -amidon transformé de manioc caramel 0,5% (sucre - sirop de glucose de blé eau) sel. Pourcentages exprimés sur le mini-éclair au caramel.  Mini-éclair au chocolat:  lait demi écrémé stérilisé -fondant 14,3% (sucre - eau - sirop de glucose émulsifiant : mono et diglycérides d\'acides gras - épaississants : agar agar, farine de graines de caroube) chocolat noir de couverture 10,8 % (pâte de cacao - sucre cacao maigre en poudre émulsifiant: lécithine de soja - arôme naturel de vanille) - œuf entier pasteurisé sucre - eau - farine de blé - jaune d\'oeuf pasteurisé beurre - pâte de cacao 2,7% - beurre de cacao 1,3%- amidon transformé de manioc - gélifiant : carraghénanes sel. Pourcentages exprimés sur le mini-éclair au chocolat.  Moelleux amande-citron :  oeuf entier pasteurisé sucre amande en poudre 18,3% - purée de citron 7% (citron 6,3%-sucre 0,7%) - beurre 5,8 % - amande 5,2 % - zeste de citron semi confit 3,4 % (sirop de glucose-fructose - zestes de citron jaune 0,8% - eau - sucre correcteur d\'acidité acide citrique antioxydant : acide ascorbique) fécule de manioc sirop de sucre inverti. Pourcentages exprimés sur le moelleux amande-citron. Traces de graines de sésame et d\'autres fruits à coque Les informations en gras sont destinées aux personnes allergiques ou intolérantes.', 'https://static.openfoodfacts.org/images/products/326/385/992/6113/front_fr.8.400.jpg', '19.1', '10.2', '39.5', '28', '', '6.2', '0.39', '0.153543307086614', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3263859926212', 'Mignardises', 'Tartelette framboise : framboises 46,8 %, fond de tartelette sucré 25,2 % (farine de _blé_, _beurre_ 5,5 %, sucre glace, _oeuf_ entier pasteurisé, eau, fibres de _blé_, fécule de manioc), sucre, chocolat blanc (sucre, beurre de cacao, poudre de _lait_ entier, émulsifiant : lécithine de _soja_, arôme naturel de vanille), beurre de cacao, gélifiant : pectines, chocolat de couverture (pâte de cacao, sucre, beurre de cacao, lécithine de _soja_, extrait de vanille. Pourcentages exprimés sur la tartelette framboise. Entremet croustillant au chocolat, caramel et nougatine : biscuit au cacao 39,2 % (_oeuf_ entier, sucre, poudre de cacao 4,4 %, eau, sucre inverti, amidon de _blé_, blanc d\'_oeuf_ en poudre, émulsifiants : mono- et diglycérides d\'acides gras, poudres à lever : diphosphates, carbonates de sodium), fourrage caramel 20,6 % [chocolat de couverture au _lait_ au caramel 6,5 % (poudre de _lait_ entier, beurre de cacao, sucre caramélisé, pâte de cacao, sucre, arôme naturel de caramel), sucre, huile de tournesol, éclats de biscuits (farine de _blé_, sucre, farine de malt de _blé_, amidon de _blé_, poudre à lever : bicarbonate de sodium, sel, arôme naturel de vanille), _lait_ écrémé en poudre, émulsifiant : lécithine de _soja_, épices], _crème_ stérilisée (crème de _lait_, stabilisant : carraghénanes), chocolat noir de couverture 7,3 % (pâte de cacao, sucre, cacao maigre en poudre, émulsifiant : lécithine de _soja_, arôme naturel de vanille), chocolat de couverture 4,5 % (pâte de cacao, sucre, beurre de cacao, lécithine de _soja_, extrait de vanille), chocolat de couverture au _lait_ 3,7 % (sucre, beurre de cacao, poudre de _lait_ entier, pâte de cacao, émulsifiant : lécithine de _soja_, sel, arôme naturel de vanille), _oeuf_ entier pasteurisé, sucre, brisures de nougatine 2,1 % (sucre, _amandes_ torréfiées 1 %), nappage (eau, sucre, sirop de glucose-fructose, gélifiants : pectines, carraghénanes, acidifiant : acide citrique), jaune d\'_oeuf_ pasteurisé, eau, huile de tournesol, beurre de cacao. Pourcentages exprimés sur l\'entremet croustillant au chocolat, caramel et nougatine. Tartelette caramel : caramel au _beurre_ et au sel de Guérande 37,2 % [sirop de glucose-fructose, confiture de _lait_ (_lait_ entier frais, sucre, _lait_ écrémé en poudre), _beurre_ 6,3 %, sucre, eau, _lait_ entier en poudre, sel de Guérande 0,1 %, jus de citron], fond de tartelette sucré 31,9 % (farine de _blé_, _beurre_ 7 %, sucre glace, _oeuf_ entier pasteurisé, eau, fibres de _blé_, fécule de manioc), _lait_ demi-écrémé stérilisé, chocolat de couverture (pâte de cacao, sucre, beurre de cacao, poudre de _lait_ entier, extrait de vanille), chocolat blanc (sucre, beurre de cacao, poudre de _lait_ entier, émulsifiant : lécithine de _soja_, arôme naturel de vanille), beurre de cacao, amidon transformé de manioc, fécule de manioc, huile de tournesol. Pourcentages exprimés sur la tartelette au caramel. Moelleux pommes et amandes : compote de pommes 27 % (purée de pommes 20,3 %, sucre), _amandes_ en poudre 18,3 %, _oeuf_ entier pasteurisé, sucre, _beurre_, _amandes_ 6,7 %. Pourcentages exprimés sur le moelleux pommes et amandes.', 'https://static.openfoodfacts.org/images/products/326/385/992/6212/front_fr.13.400.jpg', '20.5', '10.6', '41.2', '32.8', '', '6', '0.3', '0.118110236220472', '', '0');

