VALUES ('3263859951511', '12 Macarons', 'Assortiment de 12 macarons congelés : 3 macarons chocolat, 3 macarons framboise, 3 macarons mangue passion, 3 macarons pistaches, congelés Ingrédients Macaron chocolat : sucre glace - amande 18,6% - blanc d\'œuf - crème (crème de lait - stabilisant : carraghénanes) - eau - chocolat noir de couverture 7,3% (pâte de cacao - sucre - cacao maigre en poudre - émulsifiant : lécithine de soja - arôme naturel de vanille) - chocolat de couverture 2,9% (pâte de cacao - sucre - beurre de cacao - lécithine de soja - extrait de vanille) - sirop de sucre inverti - poudre de cacao maigre alcaline - sucre - blanc d\'œuf en poudre. Macaron framboise : sucre glace - fourrage à la framboise 28% (sucre - brisure de framboise 7,6% - purée de framboise 7,6% - jus de citron - gélifiant : pectine) - amande 18,5% - blanc d\'œuf - eau - sucre - colorant : rouge de betterave - blanc d\'œuf en poudre. Macaron mangue et passion : sucre glace - amande 19,6% - purée de mangue 13,2% (mangue 1 - sucre) - blanc d\'œuf - sucre - eau - purée de fruit de la passion 3,4% (fruit de la passion 3% - sucre) - gélifiant : pectine - blanc d\'œuf en poudre - colorant : curcumine - arôme naturel de mangue 0, (contient céleri) - arôme naturel de passion 0, I Macaron pistache : sucre glace - amande 21 - blanc d\'œuf - beurre - sucre - eau - lait demi écrémé - jaune d\'œuf - pistache I - blanc d\'œuf en poudre - arôme naturel d\'amande amère - colorants : complexes cuivre-chlorophylles - curcumine. Traces de gluten, sésame et autres fruits à coque. Les informations en gras sont destinées aux personnes allergiques ou intolérantes.', 'https://static.openfoodfacts.org/images/products/326/385/995/1511/front_fr.4.400.jpg', '17.2', '3.9', '54.4', '54.1', '5.9', '7.2', '0.1', '0.0393700787401575', '', '0');

