VALUES ('3263859952013', 'Marrons entiers surgelés', 'Marrons surgelés Ingrédient 100% marrons. A la casserole : plonger les marrons dans l\'eau bouillante et les laisser cuire 10 minutes à ébullition. Les et les utiliser comme un produit frais. Déposer marrons dans le panier et laisser cuire 20 minutes à partir de la mise en rotation de la soupape. Conditions de conservation *24 heures au réfrigérateur. — 3 iours dans le compartiment à glace du réfrigérateur. —Plusieurs mois au congélateur à - 180C, jusqu\'à la date indiquée sur le sachet. NE JAMAIS RECONGELER UN PRODUIT DÉCONGELÉ.', '', '0.6', '0', '20.3', '4.9', '10.6', '3.8', '0.01', '0.00393700787401575', '', '1');

