VALUES ('3263859976514', 'Delice de sorbet', 'Sorbet plein fruit à l\'abricot, à la pêche blanche et à la pêche de vigne, aromatisé Ingrédients Purée d\'abricot 3 % - eau - sucre - purée de pêche blanche 9,2% - purée de pêche de vigne 9,2% - sirop de glucose déshydraté - stabilisants : hydroxypropylméthyl - cellulose, farine de graines de caroube, gomme guar - acidifiant : acide citrique - antioxydant : acide ascorbique - arôme naturel. Traces de lait, d\'œuf, de fruits à coque et de soja. Conseil de préparation Sortir du congélateur quelques minutes avant de déguster. Conditions de conservation *** Plusieurs mois dans le compartiment à - 180C d\'un réfrigérateur ou dans un congélateur jusqu\'à la date de durabilité minimale. ATTENTION, NE JAMAIS RECONGELER UN PRODUIT DÉCONGELÉ. A enneommer.de Dréférence avant le / NO de lot : voir sur le côté du bac.', 'https://static.openfoodfacts.org/images/products/326/385/997/6514/front_fr.4.400.jpg', '0', '0', '25.4', '21.08', '', '0.5', '0', '0', '', '1');

