VALUES ('3263859977016', 'Desserts glacés', 'eau-crème fraiche-sucre-amandes 6,5%-purée de framboise 4% - lactose et protéines de lait - lait écrémé en poudre dextrose-chocolat blanc (sucre-beurre de cacao - poudre de lait entier-lactosérum en poudre - émulsifiant: lécithine de soja arôme naturel de vanille)-huile de tournesol-beurre de cacao - lait d\'amande sucré 0,7% (sucre de canne - eau-amande 0,07% extrait d\'amande amère)-étoile en chocolat noir (pâte de cacao - sucre-beurre de cacao-émulsifiant: lécithine de tournesol - arôme naturel de vanille) - concentre (radis, cassis et pomme)-émulsifiant : mono - et diglycérides d\'acide gras-arôme nature (contient amande)-stabilisants :farine de graines de caroube, gomme guar - sirop de glucose - miel. Traces de gluten, oeuf et autres fruits à coque. Les informations en gras sont destinees aux personnes allergiques ou intolérantes. Conditions de préparation Sortir du congélateur quelques minutes avant de déguster.', 'https://static.openfoodfacts.org/images/products/326/385/997/7016/front_fr.7.400.jpg', '16.2', '7.5', '22.8', '22.6', '', '4', '0.14', '0.0551181102362205', '', '0');

